DROP TABLE IF EXISTS `user_info`;
CREATE TABLE `user_info` (
  `ID` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `UserName` varchar(20) DEFAULT 'aaa' COMMENT '用户名称',
  `Password` varchar(20) DEFAULT NULL COMMENT '用户密码',
  `Email` varchar(50) DEFAULT NULL COMMENT '电子邮件',
  `Address` varchar(200) DEFAULT NULL COMMENT '地址',
  `CountryID` int(11) unsigned DEFAULT NULL COMMENT '国家ID',
  `CityID` int(11) unsigned DEFAULT NULL COMMENT '城市ID',
  `SNSAccount` varchar(50) DEFAULT NULL COMMENT 'QQ、MSN帐号',
  `WorkFlowID` varchar(50) DEFAULT NULL COMMENT '工作流ID',
  `Create_Date` datetime DEFAULT NULL COMMENT '创建时间',
  `Create_User` varchar(20) DEFAULT NULL COMMENT '创建者用户',
  PRIMARY KEY (`ID`),
  KEY `FK_User_Info_CountryID_Country_Info_ID` (`CountryID`),
  KEY `FK_User_Info_CityID_Country_Info_ID` (`CityID`),
  CONSTRAINT `FK_User_Info_CityID_Country_Info_ID` FOREIGN KEY (`CityID`) REFERENCES `country_info` (`ID`),
  CONSTRAINT `FK_User_Info_CountryID_Country_Info_ID` FOREIGN KEY (`CountryID`) REFERENCES `country_info` (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=gb2312 COMMENT='用户信息';

